import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../assets/images/Logo.png';

const Navbar = () => (
  <div className="flex flex-row justify-around items-center px-5 mt-[20px] sm:mt-[32px] gap-[40px] sm:gap-[123px]">
    <Link to="/">
      <img src={Logo} alt="logo" className="w-12 h-12 mx-5" />
    </Link>

    <div className="flex flex-row gap-[40px] items-end text-[24px] font-serif">
      <Link
        to="/"
        className="text-[#3A1212] border-b-[3px] border-[#1E90FF] no-underline"
      >
        Home
      </Link>
      <a href="#exercises" className="text-[#3A1212] no-underline">
        Exercises
      </a>
    </div>
  </div>
);

export default Navbar;
